import React, { Component } from 'react';

//Componentes
import Header from './Header';

class App extends Component {
  render() {
    return (
      <div className="contenedor">
       <Header
         titulo='Cotizador de seguro de Auto'
         />
      </div>
    );
  }
}

export default App;
